graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Login Flow</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "LoginForm" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoginForm</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Login Form</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ValidateCredentials" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ValidateCredentials</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Validate Credentials</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "TwoFactorAuth" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>TwoFactorAuth</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Two-Factor Authentication</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "LoginSuccess" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoginSuccess</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Login Success</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "LoginFailure" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoginFailure</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Login Failed</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "LoginForm" -> "ValidateCredentials" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ValidateCredentials" -> "TwoFactorAuth" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>success</b></td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD"];
  "TwoFactorAuth" -> "LoginSuccess" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ValidateCredentials" -> "LoginFailure" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>failure</b></td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD"];
}
